import React, { useEffect, useState } from 'react';
import './App.css';
import {getPlayerIconPNGLink} from './LeagueOfLegendsApi.js';

/**
 * League player profile for Myslibros
 */
function LeagueProfile(props) {

    useEffect(() => {
        fetchPlayers();
    }, []); 

    const [player, setPlayer] = useState([]);

    const fetchPlayers = async () => {
        var obj = new Object();
        obj.name = props.leagueName;
        obj.iconSrc = await getPlayerIconPNGLink(props.leagueName);
        const player = obj.JSON;
        console.log(player);

        setPlayer(player);
      };
    
      console.log(player.name);

    return (
        <div className="league-profile">
            <div className="league-name">
                <img src={player.iconSrc}></img>
                <h1>{player.name}</h1>
            </div>
            <div className="league-info">

            </div>
        </div>
    );
}

export default LeagueProfile;
